        imgsrc:web,
        title:"web development",
    },
    {
        imgsrc:android,
        title:"Abndroid development"
    },
    {
        imgsrc:software,
        title:"Abndroid development"
    },
    {
        imgsrc:android,
        title:"Abndroid development"
    },
    {
        imgsrc:android,
        title:"Abndroid development"
    },
    {
        imgsrc:android,
        title:"Abndroid development"
    }
]
export default Sdata;
